                    </ul> */}

          {/* <div class="dropdown">
            <span>Mouse over me</span>
            <div class="dropdown-content">
              <p>Hello World!</p>
            </div>
          </div> */}
            <div className="dropdown">
                <div className="dropdown-btn">
                    Portfolio
                </div>
                <div className="dropdown-content">
                    <div className="dropdown-items">
                        Create a Portfolio
                    </div>
                    <div className="dropdown-items">
                        
                    </div>
                </div>
            </div>
        </LogoNav>
        <Nav></Nav>
      </Header>
    </>
  );
};

export default IndexComponent;
